import React, { useRef } from 'react'
import { useGLTF } from '@react-three/drei'
const testMesh = require("../../assets/3dModels/testMesh.gltf")

export default function Skullboard(props){
    const group = useRef()
    const { nodes, materials } = useGLTF(testMesh)
    return (
      <group ref={group} {...props} dispose={null}>
        <mesh castShadow receiveShadow geometry={nodes.Curve007_1.geometry} material={materials['Material.001']} />
        <mesh castShadow receiveShadow geometry={nodes.Curve007_2.geometry} material={materials['Material.002']} />
      </group>
    )
  
}

useGLTF.preload(testMesh)
